// If injecting into an app that was already running at the time
// the app was enabled, simply initialize it.
if (document.documentElement) {
  initialize();
}

// Otherwise, we need to wait for the DOM to be ready before
// starting initialization since add-ons are injected
// *before* `document.documentElement` is defined.
else {
  window.addEventListener('DOMContentLoaded', initialize);
}

function initialize() {
  if (document.querySelector('.fxos-banner')) {
    // Already injected, abort.
    return;
  } else {
  
    var imageBackgroundBase64 = get_image_base64();
  
    var body = document.getElementById('icons');
    var fxosBanner = document.createElement('div');
    fxosBanner.classList.add('fxos-banner');
    fxosBanner.setAttribute('style', 'font-size: 14px; font-weight: bold; background-color: rgba(0,0,0,0.7); position: relative; width: 90%; height: 175px; margin-left: 5%; margin-right: 5%; border: 1px solid black; color: white;');
    var bannerPicture = document.createElement('div');
    //bannerPicture.src="css/timagin.jpg";
    bannerPicture.id="banner-countdown";
    bannerPicture.setAttribute('style', 'background-image: '+imageBackgroundBase64+'; background-repeat: no-repeat; background-size: cover; min-height: 100px; width: 100%; border-bottom: 1px solid black;');
    var countdownText = document.createElement('div');
    countdownText.id="phjou-countdown";
    var closeBtn = document.createElement('button');
    
    countdownText.setAttribute('style', 'float: left; padding-top: 0.5em; width: 75%; line-height: 16px; left: 1em; margin: 0; margin-left: 5%;');
    closeBtn.setAttribute('style', 'width: 20%; padding-top: 0.5em; font-size: 18px; line-height: 2em; right: 0.33em; border: none; background: none; display: block; color: white;');

    fxosBanner.appendChild(bannerPicture);
    fxosBanner.appendChild(countdownText);
    fxosBanner.appendChild(closeBtn);
    body.insertBefore(fxosBanner, body.firstChild);
    compte_a_rebours("T'imagin 2", "Mar 12 00:00:00 2016");

    closeBtn.textContent = 'X';

    closeBtn.onclick = function() {
    	fxosBanner.parentNode.removeChild(fxosBanner);
    }
  }
}

function compte_a_rebours(nom_evenement, date_fin) {
  var nIntervId = setInterval(function() {
    compte_a_rebours_task(nom_evenement, date_fin);
  }, 1000);
}

function compte_a_rebours_task(nom_evenement, date_fin)
{
	var compte_a_rebours = document.getElementById("phjou-countdown");
	var compte_a_rebours_p = document.querySelector("#phjou-countdown p");
	if(compte_a_rebours_p !== null) {
	  compte_a_rebours_p.parentNode.removeChild(compte_a_rebours_p);
	}
	var compte_a_rebours_p = document.createElement('p');

	var date_actuelle = new Date();
	var date_evenement = new Date(date_fin);
	var total_secondes = (date_evenement - date_actuelle) / 1000;

	var prefixe = nom_evenement+" dans ";
	if (total_secondes < 0)
	{
		prefixe = "Compte à rebours terminé il y a "; // On modifie le préfixe si la différence est négatif

		total_secondes = Math.abs(total_secondes); // On ne garde que la valeur absolue

	}

	if (total_secondes > 0)
	{
		var jours = Math.floor(total_secondes / (60 * 60 * 24));
		var heures = Math.floor((total_secondes - (jours * 60 * 60 * 24)) / (60 * 60));
		minutes = Math.floor((total_secondes - ((jours * 60 * 60 * 24 + heures * 60 * 60))) / 60);
		secondes = Math.floor(total_secondes - ((jours * 60 * 60 * 24 + heures * 60 * 60 + minutes * 60)));

		var et = "et";
		var mot_jour = "jours,";
		var mot_heure = "heures,";
		var mot_minute = "minutes,";
		var mot_seconde = "secondes";

		if (jours == 0)
		{
			jours = '';
			mot_jour = '';
		}
		else if (jours == 1)
		{
			mot_jour = "jour,";
		}

		if (heures == 0)
		{
			heures = '';
			mot_heure = '';
		}
		else if (heures == 1)
		{
			mot_heure = "heure,";
		}

		if (minutes == 0)
		{
			minutes = '';
			mot_minute = '';
		}
		else if (minutes == 1)
		{
			mot_minute = "minute,";
		}

		if (secondes == 0)
		{
			secondes = '';
			mot_seconde = '';
			et = '';
		}
		else if (secondes == 1)
		{
			mot_seconde = "seconde";
		}

		if (minutes == 0 && heures == 0 && jours == 0)
		{
			et = "";
		}
		compte_a_rebours_p.appendChild(document.createTextNode(prefixe + jours + ' ' + mot_jour + ' ' + heures + ' ' + mot_heure + ' ' + minutes + ' ' + mot_minute + ' ' + et + ' ' + secondes + ' ' + mot_seconde));
		
	}
	else
	{
		compte_a_rebours_p.appendChild(document.createTextNode('Compte à rebours terminé.'));
	}
        compte_a_rebours.appendChild(compte_a_rebours_p);
}

function get_image_base64() {
  return ('url(\'data:image/jpeg;base64,\')');
}
